import React from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import TemperatureChart from './TemperatureChart';

function Charts() {
  return (
    <div>
        <Card>
            <CardContent>
                <TemperatureChart />
            </CardContent>
        </Card>
    </div>
  );
}

export default Charts;
